import React from 'react'
import InfoContextProvider from '../InfoContent/PitsaCard/PitsaCard';
import MainContext from '../InfoContent/PitsaCard/MainContent/MainContent';
import NavbarCard from '../NavbarCard/NavbarCard';
import Address from '../Address/Address';

export default function Home() {
  return (
    <div className='bg-light'>
        <div className="container-xxl">
        <NavbarCard/>
        
        <Address/>
        <InfoContextProvider>
            <h1>Пицца</h1>
            <MainContext/>
        </InfoContextProvider>
        </div>
        
    </div>
  )
}
